import React from "react";
import Array from './Array'

function Card() {
  return (
    <div>
      <div>
        <li>{Array[0].id}</li>
        <li>{Array[0].name}</li>
        <li>{Array[0].age}</li>
        <li>{Array[0].degree}</li>
      </div>
    </div>
  );
}

export default Card;
